import React, { useState } from 'react';
import axios from 'axios';

const SetNewPasswordForm = () => {
    const [passwordData, setPasswordData] = useState({
        password: '',
        token: '',
        uid: ''
    });

    const handleChange = (e) => {
        setPasswordData({
            ...passwordData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://127.0.0.1:8000/users/api/SetNewPassword/', passwordData, {
                headers: { 'Content-Type': 'application/json' }
            });
            alert(response.data.message);
        } catch (error) {
            console.error('Error setting new password:', error);
            alert('Error setting new password');
        }
    };

    return (
        <div className="container">
            <h2>Set New Password</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>New Password</label>
                    <input type="password" name="password" className="form-control" placeholder="New Password" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>Token</label>
                    <input type="text" name="token" className="form-control" placeholder="Token" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <label>User ID</label>
                    <input type="text" name="uid" className="form-control" placeholder="User ID" onChange={handleChange} required />
                </div>
                <button type="submit" className="btn btn-primary">Set New Password</button>
            </form>
        </div>
    );
};

export default SetNewPasswordForm;
